import './body.css'
import React from 'react'
import Particles from 'react-particles-js'

function Body() {
    return (
        <div className="body">
            <div className="lead">
                WILL SATHER
            </div>

            <Particles id="particles-js" 
            params={{
                particles: {
                    number: {
                        value: 400,
                        density: {
                            enable: true,
                            value_area: 1000
                        }
                    },
                    color: {
                        value: '#fff'
                    },
                    opacity: {
                        value: .5,
                        anim: {
                            enable: true
                        }
                    },
                    size: {
                        value: 7,
                        random: true,
                        anim: {
                            anim: true,
                            speed: 3
                        }
                    },
                    linke_linked: {
                        enable: true
                    },
                    move: {
                        speed: .2
                    }
                }
            }}
            />
        </div>
    );
  }

  export default Body;
